import { User } from "asv-hlps";

export class HlpUserSignature {
  static getImgSignature(user: User) {
    switch (user.username.substring(3).trimEnd()) {
      case "11005" /* fortun√©ee */:
        return "data:image/png;base64,";
      case "19028" /* luc */:
        return "data:image/png;base64,";
      case "18004" /* stella */:
        return "data:image/png;base64,";
      case "20015" /* rhaissa */:
        return "data:image/png;base64,";
      case "15008" /* hubertine */:
        return "data:image/png;base64,";
      default:
        return "";
    }
  }

  static getSignature(user: User) {
    const signature = this.getImgSignature(user);
    if (signature) {
      return {
        image: signature,
        width: 40,
        height: 40,
        alignment: "right",
        margin: [0, 0, 100, 0],
      };
    }
    return "";
  }
}
